import React from 'react';

const Card = (props) => {
	return (
		<div className='tc bg-light-gray dib br2 pa2 ma2 bw2 shadow-5'>
			<h2>{props.name}</h2>
			<a target='new' href={props.email}>{props.email}</a>
			<p>{props.city}</p>
		</div>
	);
}

export default Card;
